(12, 'Introdução à Psicanálise', NULL, '1', '2018-03-19 14:16:54', '2018-03-19 14:16:54', 'doc', '<p><span style="color:rgb(0, 0, 0); font-family:calibri,sans-serif; font-size:14.6667px">&nbsp;Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fazer uma pesquisa de 02 a 04 laudas sobre a &quot;</span><strong>TEORIA TOPOGR&Aacute;FICA DE FREUD&quot;.</strong></p>\r\n', '544980', 'spp__5ab5a3fc64fa95_18476370.doc'),
(14, 'Teoria Psicanalítica I - Escola Freudiana', NULL, '1', '2018-03-19 14:27:02', '2018-03-19 14:27:02', 'doc', '<p>&nbsp;Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fazer uma pesquisa de 02 a 04 laudas sobre &quot;O QUE &Eacute; O COMPLEXO DE &Eacute;DIPO PARA A PSICAN&Aacute;LISE&quot;.</p>\r\n', '585714', 'spp__5ab5a57553e7b5_16346342.doc'),
(15, 'Ética Psicanalítica', NULL, '1', '2018-03-23 22:11:35', '2018-03-23 22:11:35', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a&nbsp;um RESUMO&nbsp;de 02 a 04 laudas sobre &quot;O CASO ANA O.&quot;</p>\r\n', '391529', 'spp__5ab5a5c74c2081_53127647.doc'),
(16, 'Teorias da Sexualidade I ', NULL, '1', '2018-03-23 22:13:27', '2018-03-23 22:13:27', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre &quot;FASES DO DESENVOLVIMENTO PSICOSSEXUAL&quot;.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '458767', 'spp__5ab5a6370f8799_09091383.doc'),
(17, 'Teoria Psicanalítica II - Winnicott e M. Klein', NULL, '1', '2018-03-23 22:15:57', '2018-03-23 22:15:57', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo desenvolva um texto&nbsp;de 02 a 04 laudas sobre&nbsp;o tema:&nbsp;<strong>EXPLIQUE A POSI&Ccedil;&Atilde;O ESQUIZOPARAN&Oacute;IDE DE MELANIE KLEIN E O TERMO &ldquo;M&Atilde;E SUFICIENTEMENTE BOA&rdquo; DE WINNICOTT</strong></p>\r\n', '144814', 'spp__5c26ad6a75f515_85295466.doc'),
(18, 'Psicopatologia Psicanalítica I ', NULL, '1', '2018-03-23 22:18:02', '2018-03-23 22:18:02', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo&nbsp;<strong>DESCREVA COM SUAS PALAVRAS O QUE &Eacute; NEUROSE E PSICOSE.&nbsp;</strong></p>\r\n\r\n<p>O texto deve ter no m&iacute;nimo 02 e no m&aacute;ximo 04 laudas.</p>\r\n', '916861', 'spp__5ab5a74a9f6d40_10100385.doc'),
(19, 'Teorias da Sexualidade II - Édipo e Narciso', NULL, '1', '2018-03-23 22:19:09', '2018-03-23 22:19:09', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>NARCISISMO PRIM&Aacute;RIO E SECUND&Aacute;RIO EM FREUD&quot;.</strong></p>\r\n', '678871', 'spp__5ab5a78d3c2348_41159518.doc'),
(20, 'Psicopatologia Psicanalítica II', NULL, '1', '2018-03-23 22:20:19', '2018-03-23 22:20:19', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>DEPRESS&Atilde;O: A DOEN&Ccedil;A DO S&Eacute;CULO. SEUS SINTOMAS, SUAS CAUSAS, SUAS ORIGENS E SEU TRATAMENTO NA CL&Iacute;NICA PSICANAL&Iacute;TICA.&quot;</strong></p>\r\n', '216478', 'spp__5ab5a7d3af5c34_67295041.doc'),
(21, 'Teorias da Sexualidade III - Perversões', NULL, '1', '2018-03-23 22:21:24', '2018-03-23 22:21:24', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>PEDOFILIA &ndash; CAUSAS E TRATAMENTOS.&quot;</strong></p>\r\n', '846867', 'spp__5ab5a8142dcc96_94401772.doc'),
(22, 'Teoria Psicanalítica III - Escola Junguiana', NULL, '1', '2018-03-23 22:22:32', '2018-03-23 22:22:32', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>DIFEREN&Ccedil;A ENTRE O INCONSCIENTE INDIVIDUAL E O INCONSCIENTE COLETIVO&quot;</strong></p>\r\n', '507307', 'spp__5ab5a8587319b8_56279944.doc'),
(23, 'Psicoterapia Psicanalítica Breve', NULL, '1', '2018-03-23 22:23:32', '2018-03-23 22:23:32', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo responda ao QUESTION&Aacute;RIO.</p>\r\n', '260329', 'spp__5ab5a894d58441_08116865.doc'),
(24, 'Terapia Familiar - Abordagem Psicanalítica e Sistêmica', NULL, '1', '2018-03-23 22:24:47', '2018-03-23 22:24:47', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a um RESUMO de 02 a 04 laudas sobre&nbsp;&quot;<strong>AN&Aacute;LISE DE UMA FOBIA EM UM MENINO DE CINCO ANOS (O PEQUENO HANS)&quot;</strong></p>\r\n', '172498', 'spp__5ab5a8df1c2d27_54870975.doc'),
(25, 'Toxicopatologia - Narcose e Psicose ', NULL, '1', '2018-03-23 22:26:03', '2018-03-23 22:26:03', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas&nbsp;sobre &quot;<strong>O QUE &Eacute; COMORBIDADE E CODEPEND&Ecirc;NCIA? QUAL A IMPORT&Acirc;NCIA DE AMBAS NA CL&Iacute;NICA PSICANAL&Iacute;TICA?&quot;</strong></p>\r\n', '491230', 'spp__5ab5a92ba24605_50401606.doc'),
(26, 'Análise Transacional', NULL, '1', '2018-03-23 22:26:48', '2018-03-23 22:26:48', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>AS FUN&Ccedil;&Otilde;ES DO EGO EM FREUD&quot;</strong></p>\r\n', '270361', 'spp__5ab5a9735d56e7_84588192.doc'),
(27, 'Teoria Psicanalítica IV - Escola Lacaniana', NULL, '1', '2018-03-23 22:28:29', '2018-03-23 22:28:29', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo responda ao QUESTION&Aacute;RIO.</p>\r\n', '813968', 'spp__5ab5a9bdd1b4d6_86987142.doc'),
(28, 'Técnica Psicanalítica I', NULL, '1', '2018-03-23 22:29:59', '2018-03-23 22:29:59', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo, em 02 a 04 laudas,&nbsp;&quot;<strong>EXPLIQUE COM SUAS PALAVRAS O QUE &Eacute; A RESIST&Ecirc;NCIA E A TRANSFER&Ecirc;NCIA?&quot;</strong></p>\r\n', '616822', 'spp__5ab5aaac7458b0_54789329.doc'),
