(30, 'Psicanálise e Religião', NULL, '1', '2018-03-23 22:35:42', '2018-03-23 22:35:42', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre&nbsp;&quot;<strong>OBSESS&Atilde;O E COMPULS&Atilde;O &ndash; CAUSAS, SINTOMAS E TRATAMENTO&quot;</strong></p>\r\n', '332616', 'spp__5ab5ab6ea98814_42493571.doc'),
(32, 'Teorias das Pulsões', NULL, '1', '2018-04-03 14:55:03', '2018-04-03 14:55:03', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo far&ccedil;a uma pesquisa de 02 a 04 laudas sobre &quot;EROS E THANATOS NA PSICAN&Aacute;LISE&quot;.</p>\r\n', '383911', 'spp__5ac3bff77e8827_64379332.doc'),
(55, 'Psicanálise e Filosofia', NULL, '1', '2018-10-02 22:08:51', '2018-10-02 22:08:51', 'doc', '<p>Fa&ccedil;a um texto explicando <strong>Como a psican&aacute;lise freudiana proporcionou o descentramento do sujeito, representado, sobretudo, pelas filosofias de Descartes e Kant.</strong></p>\r\n', '112645', 'spp__5bb416aec1bfa5_71488107.doc'),
(57, 'Psicofarmacologia', NULL, '1', '2018-10-04 16:21:51', '2018-10-04 16:21:51', 'doc', '<p>Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo desenvolva um texto&nbsp;de 02 a 04 laudas sobre&nbsp;o tema:&nbsp;<strong>QUAL A IMPORT&Acirc;NCIA DO CONHECIMENTO DA PSICOFARMACOLOGIA PARA O ANALISTA?</strong></p>\r\n', '815552', 'spp__5bb66869849887_39546407.doc'),
(58, 'Psicanálise e Religião', NULL, '1', '2018-10-04 17:38:42', '2018-10-04 17:38:42', 'doc', '<p><span style="color:rgb(0, 0, 0); font-family:calibri,sans-serif; font-size:14.6667px">Para avalia&ccedil;&atilde;o do respectivo M&oacute;dulo fazer uma pesquisa de 02 a 04 laudas sobre:&nbsp;</span><strong>OBSESS&Atilde;O E COMPULS&Atilde;O &ndash; CAUSAS, SINTOMAS E TRATAMENTO.</strong></p>\r\n', '121860', 'spp__5bb67a526c7947_84309582.doc'),
(59, 'Psicanálise e o Social', NULL, '1', '2018-12-01 09:28:06', '2018-12-01 09:28:06', 'doc', '<p>Para avalia&ccedil;&atilde;o do referido m&oacute;dulo, fa&ccedil;a uma pesquisa de 02 a 04 laudas sobre: O &quot;Mal-estar na civiliza&ccedil;&atilde;o&quot; versus atualidade.</p>\r\n', '613587', 'spp__5c02707574c449_15624674.doc'),
