(61, 'Neuroanatomia e Neurofisiologia', NULL, '1', '2018-12-01 11:04:48', '2018-12-01 11:04:48', 'doc', '<p>Para avalia&ccedil;&atilde;o do referido m&oacute;dulo, fa&ccedil;a uma pesquisa &quot;Qual a import&acirc;ncia do conhecimento do sistema nervoso central para sua forma&ccedil;&atilde;o psicanal&iacute;tica?&nbsp;</p>\r\n', '330406', 'spp__5c0286f0100341_40331480.doc'),
