INSERT INTO `aula` (`id`, `titulo`, `slug`, `status`, `created_at`, `updated_at`, `tipo`, `texto`, `code`, `file`) VALUES
(11, 'Introdução à Psicanálise', 'introducao-a-psicanalise', '1', '2017-07-20 11:46:45', '2017-07-20 11:46:45', 'Presencial', '<p>EMENTA:</p>\r\n\r\n<p>Hist&oacute;ria do movimento psicanal&iacute;tico; Conceitos elementares do que &eacute; psican&aacute;lise; Fundamentos gerais do funcionamento do psiquismo humano; Diferen&ccedil;as entre psiquiatria, psicologia e psican&aacute;lise; O trip&eacute; da forma&ccedil;&atilde;o psicanal&iacute;tica.</p>\r\n', '519420', 'spp__5baad05a9750a4_21420526.pdf'),
(12, 'Ética Psicanalítica', 'etica-psicanalitica', '1', '2017-08-23 15:53:08', '2017-08-23 15:53:08', 'Presencial', '<p>EMENTA:</p>\r\n\r\n<p>Revis&atilde;o dos principais t&oacute;picos do conte&uacute;do relacionados &agrave;s Obras de Freud; Teoria Psicanal&iacute;tica; T&eacute;cnica Psicanal&iacute;tica; Pr&aacute;tica Psicanal&iacute;tica; &Eacute;tica Psicanal&iacute;tica.</p>\r\n', '526024', 'spp__599dcf13e8d427_14321507.pdf'),
(13, 'Teorias da Sexualidade I', 'teorias-da-sexualidade-i', '1', '2017-10-17 10:23:38', '2017-10-17 10:23:38', 'Presencial', '<p>EMENTA:</p>\r\n\r\n<p>Sexualidade na &oacute;tica de Alfred Kinsey; As pesquisas de Masters &amp; Johnson; O Relat&oacute;rio de Shere Hite; Henry Havellock Ellis; Introdu&ccedil;&atilde;o ao pensamento freudiano: As fases do desenvolvimento psicossexual.</p>\r\n', '538836', 'spp__5baadf2951e8f4_97515009.pdf'),
(15, 'Teoria Psicanalítica I - Escola Freudiana', 'teoria-psicanalitica-i-escola-freudiana', '1', '2017-10-17 10:43:48', '2017-10-17 10:43:48', 'Presencial', '<p>EMENTA:</p>\r\n\r\n<p>Teoria do trauma; Teoria topogr&aacute;fica: Consciente, Pr&eacute;-consciente e Inconsciente; Teoria estrutural: Id, Ego e Superego; Teoria do narcisismo; Teoria da dissocia&ccedil;&atilde;o do ego.&nbsp;</p>\r\n', '852940', 'spp__59e5fb04d2df57_10045165.pdf'),
(16, 'Psicofarmacologia', 'psicofarmacologia', '1', '2017-11-27 15:06:39', '2017-11-27 15:06:39', 'Presencial', '<p>EMENTA:</p>\r\n\r\n<p>Introdu&ccedil;&atilde;o: conceitos gerais; Estudo das altera&ccedil;&otilde;es comportamentais; Estudo das caracter&iacute;sticas bioqu&iacute;micas de agentes farmacol&oacute;gicos e seus efeitos na fisiologia do comportamento; Antipsic&oacute;ticos; Antidepressivos; Antiman&iacute;acos; Ansiol&iacute;ticos; Alucin&oacute;genos.</p>\r\n', '991410', 'spp__5a1c461f38b279_81732511.pdf'),
