INSERT INTO `material` (`id`, `titulo`, `slug`, `status`, `created_at`, `updated_at`, `tipo`, `texto`, `code`, `file`, `link`) VALUES
(9, 'Psicanálise modelo topográfico', NULL, '1', '2017-07-20 11:58:13', '2017-07-20 11:58:13', 'doc', '', '898011', 'spp__5970c50555db67_84009381.doc', 'http://ava.spp.psc.br/material/spp__5970c50555db67_84009381.doc'),
(10, 'Que tipo de ciência é afinal a Psicanálise', NULL, '1', '2018-02-06 10:16:20', '2018-02-06 10:16:20', 'pdf', '<p>Resumo: Para Freud, a disciplina que criou fazia indiscutivelmente&nbsp;parte das ci&ecirc;ncias da Natureza, e de modo algum daquelas &ldquo;do esp&iacute;rito&rdquo;, como ent&atilde;o se chamavam na Alemanha as atuais ci&ecirc;ncias humanas.&nbsp;Para n&oacute;s, contempor&acirc;neos, tal asser&ccedil;&atilde;o parece muito estranha:&nbsp;que objeto poderia ser mais humano do que o esp&iacute;rito humano,<br />\r\ntema da Psican&aacute;lise? Este artigo retoma esse problema pelo &acirc;ngulo&nbsp;da parti&ccedil;&atilde;o entre os dois tipos de ci&ecirc;ncia que vigoravam no tempo e&nbsp;no ambiente cultural de Freud...</p>\r\n', '398725', 'spp__5a799c940c2ce2_00348779.pdf', 'http://www.ava.spp.psc.br/material/spp__5a799c940c2ce2_00348779.pdf'),
(11, 'A agressividade', NULL, '1', '2018-02-06 10:45:24', '2018-02-06 10:45:24', 'pdf', '<p>Abordamos a import&acirc;ncia da agressividade como componente&nbsp;criador, al&eacute;m da forma negativa de sentimento, relacionada com aspectos&nbsp;destrutivos que o indiv&iacute;duo normalmente dirige aos seus objetos.&nbsp;Dependendo de seu destino, pode-se voltar contra o indiv&iacute;duo como forma&nbsp;de puni&ccedil;&atilde;o, sentimento de culpa, remorso e ang&uacute;stia. Revisamos as obras&nbsp;de Freud, M. Klein e Winnicott e contrastamos os conceitos b&aacute;sicos de&nbsp;puls&atilde;o de vida e de morte, amor e &oacute;dio e a diferencia&ccedil;&atilde;o entre&nbsp;agressividade e destrutividade.</p>\r\n', '267655', 'spp__5a79a363f28109_14286046.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a363f28109_14286046.pdf'),
(12, 'A complexidade das relações entre drogas, álcool e violência', NULL, '1', '2018-02-06 10:46:40', '2018-02-06 10:46:40', 'pdf', '<p>Este artigo discute as complexas rela&ccedil;&otilde;es existentes entre drogas e viol&ecirc;ncia. Valendo-se&nbsp;de alguns estudos com base emp&iacute;rica e dos discursos correntes, analisa os problemas conceituais e metodol&oacute;gicos relacionados ao estabelecimento de nexos causais, riscos e associa&ccedil;&otilde;es. Ao demonstrar as dificuldades te&oacute;ricas e pr&aacute;ticas destas delimita&ccedil;&otilde;es, aponta tamb&eacute;m para um debate necess&aacute;rio no campo da sa&uacute;de p&uacute;blica e das pol&iacute;ticas sociais. Preocupa-se com que as interven&ccedil;&otilde;es&nbsp;e a preven&ccedil;&atilde;o n&atilde;o se contaminem por fal&aacute;cias, que em nada ajudam a compreens&atilde;o e a&nbsp;a&ccedil;&atilde;o relativas &agrave; problem&aacute;tica social das drogas.</p>\r\n', '985420', 'spp__5a79a3b029b3a8_18547247.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a3b029b3a8_18547247.pdf'),
(13, 'A construção do conceito de superego em Freud', NULL, '1', '2018-02-06 10:48:43', '2018-02-06 10:48:43', 'pdf', '<p>Cotela os conceitos preliminares nos diversos momentos da obra freudiana at&eacute; sua formaliza&ccedil;&atilde;o no texto &quot;O Ego e o Id&quot; de 1923.</p>\r\n', '883964', 'spp__5a79a42ba1bc56_26395918.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a42ba1bc56_26395918.pdf'),
(14, 'A dinâmica dos grupos de Bion e as organizações de trabalho', NULL, '1', '2018-02-06 10:49:52', '2018-02-06 10:49:52', 'pdf', '<p>W. Bion foi um psiquiatra e psicanalista ingl&ecirc;s que desenvolveu pesquisas sobre a forma&ccedil;&atilde;o e fen&ocirc;menos de grupo, entre outros assuntos. Iniciou seus trabalhos no ex&eacute;rcito ingl&ecirc;s e deu prosseguimento aos mesmoa em grupos do Instituto Tavistock, constitu&iacute;dos de pessoas com forma&ccedil;&otilde;es diversas. Muitos dos conceitos desenvolvidos em sua pesquisa se tornaram relevantes para a compreens&atilde;o de grupos de trabalho e dos fen&ocirc;menos emocionais subjacentes a eles, influenciando gera&ccedil;&otilde;es futuras de pesquisadores em diferentes &aacute;reas do conhecimento.</p>\r\n', '319926', 'spp__5a79a4701f2685_22810383.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a4701f2685_22810383.pdf'),
(15, 'A Psicanálise', NULL, '1', '2018-02-06 10:51:36', '2018-02-06 10:51:36', 'pdf', '<p>Sigmund Freud (1856-1939) foi um m&eacute;dico vienense que alterou, radicalmente, o modo de pensar a vida ps&iacute;quica. Freud ousou colocar os &ldquo;processos misteriosos&rdquo; do psiquismo,&nbsp;suas &ldquo;regi&otilde;es obscuras&rdquo;, isto &eacute;, as fantasias, os sonhos, os&nbsp;esquecimentos, a interioridade do homem, como problemas cient&iacute;ficos. A&nbsp;investiga&ccedil;&atilde;o sistem&aacute;tica desses problemas levou Freud &agrave; cria&ccedil;&atilde;o da&nbsp;Psican&aacute;lise.</p>\r\n', '426135', 'spp__5a79a4d8220179_15882396.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a4d8220179_15882396.pdf'),
(16, 'A psicopatologia psicanalítica de Freud a Lacan', NULL, '1', '2018-02-06 10:52:58', '2018-02-06 10:52:58', 'pdf', '<p>A psicopatologia psicanal&iacute;tica explica o sofrimento ps&iacute;quico pela inadequa&ccedil;&atilde;o do&nbsp;sujeito &agrave; civiliza&ccedil;&atilde;o. Freud colocava muita &ecirc;nfase na coer&ccedil;&atilde;o abusiva da sociedade<br />\r\nsobre a sexualidade, cujo efeito permanente &eacute; o sentimento universal de culpa, fonte dos obst&aacute;culos &agrave; cura pela an&aacute;lise. Lacan, ao final do seu ensino, considera<br />\r\nque esse mal radical &eacute; tamb&eacute;m a fonte de uma satisfa&ccedil;&atilde;o pulsional que n&atilde;o serve&nbsp;aos prop&oacute;sitos da civiliza&ccedil;&atilde;o, pois o sintoma &eacute; para cada sujeito uma maneira de viver<br />\r\ne ser feliz.</p>\r\n', '925522', 'spp__5a79a52a4dd170_34396341.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a52a4dd170_34396341.pdf'),
(17, 'A ética da psicanálise', NULL, '1', '2018-02-06 10:53:54', '2018-02-06 10:53:54', 'pdf', '<p>Sob a perspectiva da Psican&aacute;lise, o artigo enfoca a constitui&ccedil;&atilde;o da &eacute;tica na origem do desenvolvimento humano, tal como Freud pensou, em Totem e Tabu (1913), ao discorrer sobre o veto ao parric&iacute;dio e a Lei da Interdi&ccedil;&atilde;o do Incesto. Atrav&eacute;s do pacto ed&iacute;pico, a lei simb&oacute;lica emerge com a finalidade de harmonizar a liga&ccedil;&atilde;o entre o desejo e o sentimento de culpa. Por&eacute;m, a dificuldade de sincronizar o auto-julgamento com a emerg&ecirc;ncia do desejo, exp&otilde;e o conflito humano sob a tutela da consci&ecirc;ncia moral, do supereu e do gozo. Assim, a dimens&atilde;o moral se firma no sentimento de obriga&ccedil;&atilde;o, pelo qual concebe um sujeito culpado em rela&ccedil;&atilde;o ao desejo, enquanto a dimens&atilde;o &eacute;tica da psican&aacute;lise situa o desejo, tal qual um bem a ser alcan&ccedil;ado.</p>\r\n', '461035', 'spp__5a79a56275b531_29634279.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a56275b531_29634279.pdf'),
(18, 'Ausência paterna e o impacto na mente da criança', NULL, '1', '2018-02-06 10:56:50', '2018-02-06 10:56:50', 'pdf', '<p>&Eacute; bom lembrar que pai, para a psican&aacute;lise, &eacute; entendido como o terceiro elemento&nbsp;que ir&aacute; cortar o v&iacute;nculo simbi&oacute;tico entre a m&atilde;e e seu beb&ecirc;, t&atilde;o necess&aacute;rio num primeiro&nbsp;tempo de uma estrutura&ccedil;&atilde;o ps&iacute;quica, mas prejudicial se perpetuado. Pai &eacute; o representante da&nbsp;Lei, lei que interdita a folia inebriante da d&iacute;ade m&atilde;e-beb&ecirc;; lei que impede que o desejo&nbsp;materno &quot;devore&quot; seu produto; da lei que cria o espa&ccedil;o favor&aacute;vel ao surgimento do enigma;&nbsp;lei que convoca ao desejo, &agrave; singularidade, &agrave; apropria&ccedil;&atilde;o do campo simb&oacute;lico (campo da&nbsp;palavra e dos significantes); lei que instaura o espa&ccedil;o criador, espa&ccedil;o facilitador das&nbsp;opera&ccedil;&otilde;es simb&oacute;licas, criativas; do brincar; da aprendizagem, da constru&ccedil;&atilde;o da imagem&nbsp;corporal, etc. Logo, a entrada do pai em cena, &eacute; determinante para que o beb&ecirc;-filho possa&nbsp;ascender &agrave; condi&ccedil;&atilde;o de crian&ccedil;a-filho.</p>\r\n', '465923', 'spp__5a79a612ed5337_02925850.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79a612ed5337_02925850.pdf'),
(19, 'De Freud a Winnicot - Aspectos de uma mudança paradigmática', NULL, '1', '2018-02-06 14:32:07', '2018-02-06 14:32:07', 'pdf', '<p>Depois de esbo&ccedil;ar os elementos essenciais do paradigma freudiano, o artigo&nbsp;prossegue descrevendo a crise desse paradigma tal como ela foi vista por Winnicott,&nbsp;para articular, na sua terceira e &uacute;ltima parte, alguns dos aspectos mais inovadores da&nbsp;mudan&ccedil;a paradigm&aacute;tica operada pelo psicanalista ingl&ecirc;s na disciplina psicanal&iacute;tica.</p>\r\n', '286823', 'spp__5a79d8873e7159_48283132.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79d8873e7159_48283132.pdf'),
(20, 'Psicofármacos nos transtornos mentais', NULL, '1', '2018-02-06 14:35:17', '2018-02-06 14:35:17', 'pdf', '<p>O uso de psicof&aacute;rmacos no tratamento dos transtornos mentais, a partir dos anos 50, mudou radicalmente a falta de perspectivas que at&eacute; ent&atilde;o prevalecia no campo da psiquiatria e da sa&uacute;de mental, provocando uma ampla reformula&ccedil;&atilde;o das concep&ccedil;&otilde;es e pr&aacute;ticas vigentes, de tal forma que na atualidade, conhecer os medicamentos existentes, as evid&ecirc;ncias que embasam seu uso, s&atilde;o essenciais para um efetivo trabalho nestas &aacute;reas, mesmo para aqueles profissionais que se dedicam preferentemente &agrave; pr&aacute;tica psicoter&aacute;pica.&nbsp;</p>\r\n', '525811', 'spp__5a79d945e0ba20_88225779.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79d945e0ba20_88225779.pdf'),
(21, 'Übber coca', NULL, '1', '2018-02-06 14:38:03', '2018-02-06 14:38:03', 'pdf', '<p>Freud se interessa pelo produto e inicia suas pesquisas em 1883, ap&oacute;s&nbsp;a leitura de um artigo de Aschenbrandt que descreve o efeito da coca&iacute;na em&nbsp;soldados. Ele a experimentou em si mesmo regularmente, bem como solicitava&nbsp;que colegas a experimentassem para somar informa&ccedil;&otilde;es a sua pesquisa.<br />\r\nO envolvimento de Freud com a coca&iacute;na, por&eacute;m, n&atilde;o ocorreu apenas&nbsp;pelo uso do produto para obten&ccedil;&atilde;o de diferentes efeitos, tais como a&nbsp;autoconfian&ccedil;a em rela&ccedil;&atilde;o a sua virilidade e o al&iacute;vio da sinusite. O motivo que&nbsp;o levou a pesquisar a coca&iacute;na relacionava-se ao desejo de nela encontrar um&nbsp;rem&eacute;dio milagroso, o que viria a destac&aacute;-lo na comunidade cient&iacute;fica da sua&nbsp;&eacute;poca.</p>\r\n', '246063', 'spp__5a79d9ebeb72d8_97726541.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79d9ebeb72d8_97726541.pdf'),
(22, 'Estudo da ação psicofarmacológica', NULL, '1', '2018-02-06 14:41:03', '2018-02-06 14:41:03', 'pdf', '<p>DISSERTA&Ccedil;&Atilde;O DE MESTRADO&nbsp;</p>\r\n\r\n<p>PALAVRAS CHAVES:&nbsp;Passiflora alata, Passiflora edulis, ansiedade, mem&oacute;ria.</p>\r\n', '311629', 'spp__5a79da9fe98360_23191519.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79da9fe98360_23191519.pdf'),
(23, 'A evolução da teoria pulsional', NULL, '1', '2018-02-06 14:43:00', '2018-02-06 14:43:00', 'PDF', '', '367410', 'spp__5a79db14be25d5_48665744.PDF', 'http://www.ava.spp.psc.br/material/spp__5a79db14be25d5_48665744.PDF'),
(24, 'Um diálogo entre a psicanálise e a neurociência', NULL, '1', '2018-02-06 14:44:45', '2018-02-06 14:44:45', 'pdf', '<p>A &ldquo;problem&aacute;tica corpo/mente&rdquo; recebeu&nbsp;roupa nova com a dicotomia hardware/software, remodelando&nbsp;as quest&otilde;es sobre a materialidade da mente e sobre os&nbsp;n&iacute;veis de causalidade em jogo. Quest&otilde;es relacionadas com a&nbsp;estrutura/fun&ccedil;&atilde;o do sistema nervoso articularam-se a outras&nbsp;relativas aos modos de processamento de informa&ccedil;&atilde;o (serial&nbsp;ou em paralelo). A met&aacute;fora do homem-m&aacute;quina pareceu&nbsp;mais real do que nunca, pois nos vimos programados para&nbsp;sermos o que nos tornamos.</p>\r\n', '568678', 'spp__5a79db7d1983c1_70806018.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79db7d1983c1_70806018.pdf'),
(25, 'O conceito de pulsão de morte na obra de Freud', NULL, '1', '2018-02-06 14:48:26', '2018-02-06 14:48:26', 'pdf', '<p>O autor postula que o conceito de &ldquo;puls&atilde;o de morte&rdquo; na&nbsp;obra de Freud suscita confus&atilde;o dentro do pensamento psicanal&iacute;tico&nbsp;porque, embora encadeado com a descoberta original freudiana&nbsp;de uma psicossexualidade inconsciente, vinculada &agrave; fantasia,&nbsp;auto-er&oacute;tica e an&aacute;rquica, por outro lado favorece a id&eacute;ia de uma&nbsp;din&acirc;mica ps&iacute;quica de tipo biol&oacute;gico e inato, que faz do conflito&nbsp;ps&iacute;quico um conflito de ordem instintiva &mdash; que por defini&ccedil;&atilde;o &eacute;&nbsp;insuper&aacute;vel.</p>\r\n', '528618', 'spp__5a79dc5a3b95f1_70109614.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79dc5a3b95f1_70109614.pdf'),
(26, 'O homem dos lobos e o fantasma em Freud', NULL, '1', '2018-02-06 14:52:44', '2018-02-06 14:52:44', 'pdf', '<p>O fantasma, ou fantasia, &eacute; identificado por Freud, notadamente no caso do Homem dos Lobos (FREUD: 1918[1914]), como marcas inconscientes da estrutura ps&iacute;quica do sujeito, que se imp&otilde;em em momentos da pr&eacute;-hist&oacute;ria deste como formas de apreens&atilde;o de uma realidade ed&iacute;pica que estrutura e funda o ser desejante.</p>\r\n', '776232', 'spp__5a79dd5c996d71_12510378.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79dd5c996d71_12510378.pdf'),
(27, 'Angústia e fobia a partir do caso do Pequeno Hans', NULL, '1', '2018-02-06 14:54:00', '2018-02-06 14:54:00', 'pdf', '', '994281', 'spp__5a79dda82f6157_23021079.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79dda82f6157_23021079.pdf'),
(28, 'O sintoma de Freud a Lacan', NULL, '1', '2018-02-06 14:56:01', '2018-02-06 14:56:01', 'pdf', '<p>O artigo aborda a teoria do sintoma em Freud e a releitura efetuada por Lacan, na dimens&atilde;o do simb&oacute;lico &ndash; pelo vi&eacute;s do&nbsp;&ldquo;inconsciente estruturado como linguagem&rdquo; &ndash; e na dimens&atilde;o do real &ndash; pela vertente do &ldquo;inconsciente pulsional&rdquo;, apontando para as&nbsp;duas dimens&otilde;es do sintoma: o &ldquo;sintoma-met&aacute;fora&rdquo;, uma forma&ccedil;&atilde;o do inconsciente que se sustenta em uma satisfa&ccedil;&atilde;o de desejo e tem um sentido recalcado, que pode ser decifrado; e, o &ldquo;sintoma-letra de gozo&rdquo;, que se distingue das demais forma&ccedil;&otilde;es do inconsciente na medida em que a satisfa&ccedil;&atilde;o de desejo, nele envolvida, tem um car&aacute;ter problem&aacute;tico e paradoxal: &eacute; uma &ldquo;satisfa&ccedil;&atilde;o real&rdquo;, &ldquo;&agrave;s avessas&rdquo;,&nbsp;para al&eacute;m do princ&iacute;pio do prazer e vinculada &agrave; puls&atilde;o demorte.</p>\r\n', '887199', 'spp__5a79de21f2a165_98087131.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79de21f2a165_98087131.pdf'),
(29, 'O sujeito sintoma impotente na disfunção erétil', NULL, '1', '2018-02-06 14:57:46', '2018-02-06 14:57:46', 'pdf', '<p>A masculinidade, como sintoma, utiliza a atividade do&nbsp;p&ecirc;nis ereto como estandarte de sustenta&ccedil;&atilde;o imagin&aacute;ria da pot&ecirc;ncia&nbsp;f&aacute;lica. A instala&ccedil;&atilde;o da disfun&ccedil;&atilde;o er&eacute;til (que afeta o &oacute;rg&atilde;o) coloca&nbsp;em quest&atilde;o a masculinidade (que afeta o ser), confirmando a sensa&ccedil;&atilde;o&nbsp;subjetiva de &ldquo;impot&ecirc;ncia&rdquo; sexual &mdash; sujeito e sintoma se&nbsp;fundem no fracasso eretivo.</p>\r\n', '116789', 'spp__5a79de8a35b307_30282523.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79de8a35b307_30282523.pdf'),
(30, 'O que leva o sujeito a crer - Sujeito e crença em psicanálise', NULL, '1', '2018-02-06 14:58:57', '2018-02-06 14:58:57', 'pdf', '<p>A presente disserta&ccedil;&atilde;o tem como objetivo uma discuss&atilde;o sobre a cren&ccedil;a a&nbsp;partir das contribui&ccedil;&otilde;es de Freud e de Lacan. Ao partir do reconhecimento da sua&nbsp;presen&ccedil;a no social, particularmente no discurso religioso, tomamos como desafio&nbsp;avan&ccedil;ar do campo do fen&ocirc;meno para um exame do lugar da cren&ccedil;a no &acirc;mbito da&nbsp;estrutura ps&iacute;quica. Propomos uma aproxima&ccedil;&atilde;o entre cren&ccedil;a e transfer&ecirc;ncia e, em&nbsp;seguida, abordamos sua presen&ccedil;a no processo inaugural de simboliza&ccedil;&atilde;o do sujeito.&nbsp;Por &uacute;ltimo, damos &ecirc;nfase especial &agrave; articula&ccedil;&atilde;o da cren&ccedil;a com o mecanismo da&nbsp;Verleugnung e analisamos sua distinta participa&ccedil;&atilde;o nas estruturas cl&iacute;nicas.</p>\r\n', '613729', 'spp__5a79ded1563ab6_46201696.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79ded1563ab6_46201696.pdf'),
(31, 'Transtornos mentais comuns e o uso de psicofármacos em mulheres', NULL, '1', '2018-02-06 15:01:01', '2018-02-06 15:01:01', 'pdf', '<p>Estimar a preval&ecirc;ncia de Transtornos Mentais Comuns (TMC) e o uso de psicof&aacute;rmacos em mulheres atendidas na rede&nbsp;b&aacute;sica de sa&uacute;de. Estudo transversal utilizando o Self-Reporting Questionnaire (SRQ-20) em mulheres usu&aacute;rias das Unidades&nbsp;B&aacute;sicas de Sa&uacute;de de Barbacena, Minas Gerais, em 2013. Foram entrevistadas 360 mulheres. A preval&ecirc;ncia de TMC foi de&nbsp;41,7% (IC95%=36,6&ndash;46,8). As vari&aacute;veis que se mostraram associadas &agrave; presen&ccedil;a de TMC no modelo de regress&atilde;o log&iacute;stica&nbsp;foram: consulta com psiquiatra (OR=5,40; IC95% 2,44&ndash;11,92), fazer uso de bebidas alco&oacute;licas (OR=5,97; IC95% 2,31&ndash;15,42)&nbsp;e hist&oacute;ria de viol&ecirc;ncia dom&eacute;stica (OR=7,15; IC95% 1,80&ndash;28,35). Cerca de 30% das mulheres fazia uso de psicof&aacute;rmacos.&nbsp;A preval&ecirc;ncia elevada de TMC e o uso de psicof&aacute;rmacos refor&ccedil;am a import&acirc;ncia do conhecimento desse tema pelos profissionais&nbsp;da &aacute;rea da sa&uacute;de.</p>\r\n', '550795', 'spp__5a79df4d02b654_36354612.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79df4d02b654_36354612.pdf'),
(32, 'O sentimento de culpa e a ética em psicanálise', NULL, '1', '2018-02-06 15:09:14', '2018-02-06 15:09:14', 'pdf', '<p>Este artigo analisa o modo como a psican&aacute;lise entende a rela&ccedil;&atilde;o entre sentimento de culpa e &eacute;tica. Inicialmente associamos o mal-estar no humano &agrave; falta de orienta&ccedil;&atilde;o para seu agir no mundo; a partir da&iacute; caracterizamos o projeto &eacute;tico como a busca por esta orienta&ccedil;&atilde;o, e conseq&uuml;entemente, como uma tentativa de supera&ccedil;&atilde;o do mal-estar. A an&aacute;lise freudiana sobre o sentimento de culpa revela que a forma como este projeto se articula em nossa civiliza&ccedil;&atilde;o termina por engendrar o mal-estar. Nesta perspectiva, o sentimento de culpa pode ser entendido como fruto de uma determinada forma de articula&ccedil;&atilde;o do problema &eacute;tico.</p>\r\n', '304800', 'spp__5a79e13a99eb13_62060100.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e13a99eb13_62060100.pdf'),
(33, 'Prevalência do uso de drogas e desempenho escolar', NULL, '1', '2018-02-06 15:11:41', '2018-02-06 15:11:41', 'pdf', '<p>A preval&ecirc;ncia de experimenta&ccedil;&atilde;o de drogas em adolescentes escolares &eacute; alta, sendo&nbsp;importante detectar precocemente grupos de risco e desenvolver pol&iacute;ticas de preven&ccedil;&atilde;o do abuso e depend&ecirc;ncia dessas subst&acirc;ncias.</p>\r\n', '751521', 'spp__5a79e1cde1f3f7_39333009.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e1cde1f3f7_39333009.pdf'),
(34, 'Psicanálise e infância revisitando a obra de Françoise Dolto', NULL, '1', '2018-02-06 15:13:25', '2018-02-06 15:13:25', 'pdf', '<p>Psican&aacute;lise e inf&acirc;ncia se encontram desde a inven&ccedil;&atilde;o do legado freudiano. J&aacute; nos primeiros trabalhos de Freud &eacute; poss&iacute;vel entrever a&nbsp;import&acirc;ncia por ele dada ao infantil, sobretudo &agrave; sexualidade e sua rela&ccedil;&atilde;o com os processos inconscientes. Todavia, Freud n&atilde;o amplia a psican&aacute;lise de crian&ccedil;as a partir de sua t&eacute;cnica, tarefa que ulteriormente coube &agrave; outros&nbsp;analistas que, n&atilde;o obstante as diverg&ecirc;ncias, trouxeram enormes contribui&ccedil;&otilde;es &agrave; psican&aacute;lise de crian&ccedil;as. O presente trabalho pretende revisitar os conceitos elaborados pela psicanalista francesa Fran&ccedil;oise Dolto, no que tange ao atendimento psicanal&iacute;tico de crian&ccedil;as. Considerada uma grande personalidade da psican&aacute;lise, desenvolveu conceitos originais a partir de sua experi&ecirc;ncia cl&iacute;nica e de sua singular escuta.</p>\r\n', '300116', 'spp__5a79e235c8a0f2_06623564.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e235c8a0f2_06623564.pdf'),
(35, 'Revista brasileira de sexualidade', NULL, '1', '2018-02-06 15:15:40', '2018-02-06 15:15:40', 'pdf', '', '472722', 'spp__5a79e2bcecca01_45289116.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e2bcecca01_45289116.pdf'),
(36, 'Violência sexual contra crianças e adolescentes', NULL, '1', '2018-02-06 15:19:04', '2018-02-06 15:19:04', 'pdf', '', '423288', 'spp__5a79e3883109c5_74508290.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e3883109c5_74508290.pdf'),
(37, 'Perversão e suas versões', NULL, '1', '2018-02-06 15:21:15', '2018-02-06 15:21:15', 'pdf', '', '607148', 'spp__5a79e40b9389e9_62934535.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e40b9389e9_62934535.pdf'),
(38, 'A perversão, o desejo e a pulsão', NULL, '1', '2018-02-06 15:22:37', '2018-02-06 15:22:37', 'pdf', '<p>Retomando a orienta&ccedil;&atilde;o freudiana e a &eacute;tica da psican&aacute;lise, este artigo tem por visada justificar teoricamente a dissocia&ccedil;&atilde;o entre pervers&atilde;o e perversidade que nem sempre &eacute; clara nos discursos de psicologia. No senso comum, por exemplo, quanto &agrave; defini&ccedil;&atilde;o da pervers&atilde;o no dicion&aacute;rio, que faz pensar na maldade, na deprava&ccedil;&atilde;o, na corrup&ccedil;&atilde;o e na mal&iacute;cia, &eacute; verdade, existem! A maneira como podemos tratar disso na cl&iacute;nica &eacute; outra quest&atilde;o, mas, por defini&ccedil;&atilde;o, n&atilde;o h&aacute; regra!&nbsp;</p>\r\n', '989814', 'spp__5a79e45d82d262_46759124.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e45d82d262_46759124.pdf'),
(39, 'A psicopatologia na pós-modernidade - As alquimias no mal-estar da atualidade', NULL, '1', '2018-02-06 15:25:12', '2018-02-06 15:25:12', 'pdf', '<p>A inten&ccedil;&atilde;o deste estudo &eacute; a de circunscrever a especificidade da psicopatologia na p&oacute;s-modernidade. Para isso, procura-se demonstrar as rela&ccedil;&otilde;es daquela com a medicina e as neuroci&ecirc;ncias, assim como a sua recusa da psican&aacute;lise. Al&eacute;m disso, pretende-se mostrar como o interesse atual da psiquiatria nas pesquisas sobre as depress&otilde;es, as toxicomanias e a s&iacute;ndrome do p&acirc;nico pode ser interpretado a partir dos modelos de subjetividade promovidos pelo mundo p&oacute;s-moderno.</p>\r\n', '778692', 'spp__5a79e4f8b1a609_19802466.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e4f8b1a609_19802466.pdf'),
(40, 'A perversão, o desejo e o gozo - Articulações possíveis', NULL, '1', '2018-02-06 15:28:58', '2018-02-06 15:28:58', 'pdf', '<p>Os autores procuram subsidiar aportes para uma discuss&atilde;o acerca da especificidade estrutural da pervers&atilde;o e sua rela&ccedil;&atilde;o com o&nbsp;desejo e com o gozo. Circunscrever o campo da pervers&atilde;o a partir de sua etiologia, delimitar os processos metapsicol&oacute;gicos&nbsp;capazes de objetiv&aacute;-la e definir suas caracter&iacute;sticas espec&iacute;ficas contrapostas &agrave;s da neurose e da psicose, desde Freud, n&atilde;o constitui&nbsp;tarefa f&aacute;cil. Ao estudar esse controverso construto te&oacute;rico-cl&iacute;nico, os autores acentuam o quanto a pervers&atilde;o, na maioria das&nbsp;vezes, aparece como um conceito fronteiri&ccedil;o, t&ecirc;nue e de refer&ecirc;ncias confusas no que diz respeito &agrave; sua especificidade estrutural.&nbsp;A proposta &eacute; avan&ccedil;ar para al&eacute;m dos paradigmas freudianos, tendo como pano de fundo a dial&eacute;tica do desejo no ensino de Lacan.&nbsp;Existiria um caminho propiciador de uma articula&ccedil;&atilde;o poss&iacute;vel entre o desejo e o gozo?</p>\r\n', '586306', 'spp__5a79e5daeb2a15_01000413.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e5daeb2a15_01000413.pdf'),
(41, 'Winnicott - Uma psicanálise não edipiana', NULL, '1', '2018-02-06 15:30:46', '2018-02-06 15:30:46', 'pdf', '<p>O presente artigo parte da tese de que o problema b&aacute;sico a partir do qual foi constitu&iacute;da a psican&aacute;lise freudiana &eacute; o do complexo de &Eacute;dipo e que todas as outras dimens&otilde;es da teoria psicanal&iacute;tica tradicional remetem a esse &quot;complexo nuclear&quot;. Em seguida, o artigo tenta demonstrar que o problema central da psican&aacute;lise winnicottiana n&atilde;o &eacute; do &quot;andarilho na cama da m&atilde;e&quot; mas o do &quot;beb&ecirc; no colo da m&atilde;e&quot;, para concluir que a psican&aacute;lise desenvolvida por Winnicott n&atilde;o &eacute; mais edipiana. No final, &eacute; apresentada um avalia&ccedil;&atilde;o hist&oacute;rica e epistemol&oacute;gica desse desenvolvimento.&nbsp;</p>\r\n', '422738', 'spp__5a79e646cac9c2_87321612.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e646cac9c2_87321612.pdf'),
(42, 'Porque narciso se exercita', NULL, '1', '2018-02-06 15:32:22', '2018-02-06 15:32:22', 'pdf', '<p><span style="color:rgb(17, 17, 17); font-family:verdana,arial,helvetica,sans-serif; font-size:11.2px">Este artigo busca levantar alguns ind&iacute;cios sobre o trato com o corpo na historia do ocidente, com vistas a possibilitar a compreens&atilde;o do interesse pelas praticas corporais e a constitui&ccedil;&atilde;o da l&oacute;gica interna e da forma que esse cultivo do corpo assume seu pr&oacute;prio corpo exacerbado pelo capitalismo e por sua ideologia o liberalismo com uma &ecirc;nfase narcisista na atualidade. Parte da tese de que ocorre, ao longo do processo civilizat&oacute;rio ocidental, uma progressiva identifica&ccedil;&atilde;o do sujeito com seu pr&oacute;prio corpo.&nbsp;</span></p>\r\n', '337018', 'spp__5a79e6a61460b1_89555562.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e6a61460b1_89555562.pdf'),
(43, 'Transferência e Complexo de Édipo na obra de Freud', NULL, '1', '2018-02-06 15:35:45', '2018-02-06 15:35:45', 'pdf', '<p>Este artigo comunica algumas considera&ccedil;&otilde;es sobre o conceito de transfer&ecirc;ncia, na teoria freudiana. Especial aten&ccedil;&atilde;o &eacute; voltada para as rela&ccedil;&otilde;es entre transfer&ecirc;ncia, complexo de &Eacute;dipo e complexo de castra&ccedil;&atilde;o. Partindo dessas rela&ccedil;&otilde;es e da hip&oacute;tese segundo a qual Freud n&atilde;o apresenta um final poss&iacute;vel para o complexo de &Eacute;dipo, o presente trabalho entende que esse autor n&atilde;o fornece uma teoria sobre o final da transfer&ecirc;ncia. Esse pensamento evoca o impasse freudiano em rela&ccedil;&atilde;o aos t&eacute;rminos das an&aacute;lises. Nesse ponto, &eacute; feita uma breve refer&ecirc;ncia &agrave; teoria lacaniana sobre a castra&ccedil;&atilde;o e a transfer&ecirc;ncia ao final de an&aacute;lise.</p>\r\n', '947670', 'spp__5a79e77136c3e6_47102365.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79e77136c3e6_47102365.pdf'),
(44, 'Grupos vivenciais sob uma perspectiva Junguiana', NULL, '1', '2018-02-06 16:10:05', '2018-02-06 16:10:05', 'pdf', '<p>Este artigo tece considera&ccedil;&otilde;es quanto &agrave; possibilidade e ao alcance de grupos vivenciais, sob a perspectiva da Psicologia Anal&iacute;tica de Carl G. Jung, em nosso contexto socioecon&ocirc;mico atual. H&aacute; uma proposta pr&aacute;tica de grupos de constru&ccedil;&atilde;o de m&aacute;scaras e personagens, e a apresenta&ccedil;&atilde;o e coment&aacute;rios das contribui&ccedil;&otilde;es de diferentes autores que trazem conceitos junguianos cl&aacute;ssicos para a dimens&atilde;o grupal, consideram de maneira criativa o ritual, do ponto de vista psicol&oacute;gico, e questionam a viabilidade de trabalhos grupais. Numa abordagem mitol&oacute;gica, s&atilde;o considerados G&oacute;rgona, Dioniso, &Aacute;rtemis, Eco e Narciso, com destaque &agrave; deusa grega H&eacute;stia, cujas caracter&iacute;sticas s&atilde;o relacionadas a aspectos necessariamente presentes nos grupos vivenciais e &agrave; possibilidade de ocorrer uma experi&ecirc;ncia psicol&oacute;gica. Os grupos vivenciais s&atilde;o considerados favorecedores da perspectiva de alteridade, na medida em que cada participante tem neles a oportunidade de se afirmar e de ser confirmado, isto &eacute;, de se expressar e de refletir, num campo interacional f&eacute;rtil.</p>\r\n', '419852', 'spp__5a79ef7d961c65_08308820.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79ef7d961c65_08308820.pdf'),
(45, 'Psicoterapia infantil - Uma abordagem Junguiana', NULL, '1', '2018-02-06 16:14:45', '2018-02-06 16:14:45', 'pdf', '<p>Neste trabalho, o autor comenta a import&acirc;ncia das t&eacute;cnicas em psicoterapia infantil, da rela&ccedil;&atilde;o analista-analisando, da rela&ccedil;&atilde;o transferencial e contra-transferencial e, ainda, outro fator decisivo na psicoterapia, que &eacute; a rela&ccedil;&atilde;o ego-self. Resume os pripcipais conceitos junguianos (self, inconsciente pessoal e coletivo, consciente, ego, integra&ccedil;&atilde;o, reintegra&ccedil;&atilde;o, deintegra&ccedil;&atilde;o, arqu&eacute;tipos, anima, animus, sombra, participa&ccedil;&atilde;o m&iacute;stica). Descreve, ainda, as principais diferen&ccedil;as entre as t&eacute;cnicas psicoter&aacute;picas infantis junguianas. llustra esse trabalho, atrav&eacute;s de sua experi&ecirc;ncia cl&iacute;nica, no relato de um caso, tentando demonstrar sua t&eacute;cnica de trabalho sob o ponto de vista junguiano, usando a forma de terapia n&atilde;o-interpretativa, atrav&eacute;s de desenhos e sand-play.</p>\r\n', '731586', 'spp__5a79f095eadaf9_08090074.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f095eadaf9_08090074.pdf'),
(46, 'A família e os conflitos familiares – A mediação como alternativa', NULL, '1', '2018-02-06 16:16:27', '2018-02-06 16:16:27', 'pdf', '<p><em>A fam&iacute;lia vem sofrendo transforma&ccedil;&otilde;es com o passar dos tempos. Atualmente podem ser considerada </em>fam&iacute;lia <em>v&aacute;rias formas de aglomerados de pessoas, passando a existir novos tipos de fam&iacute;lia. Muitos conflitos surgiram a partir de mudan&ccedil;as na estrutura familiar. A media&ccedil;&atilde;o apresenta-se como mecanismo de solu&ccedil;&atilde;o de controv&eacute;rsias que exige o di&aacute;logo pac&iacute;fico e de boa-f&eacute; como instrumento nessa solu&ccedil;&atilde;o, possibilitando a continua&ccedil;&atilde;o das rela&ccedil;&otilde;es e a reconstru&ccedil;&atilde;o de v&iacute;nculos.</em></p>\r\n', '960664', 'spp__5a79f0fba1aba4_30845000.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f0fba1aba4_30845000.pdf'),
(47, 'O diagnóstico em psicanálise - Do fenômeno à estrutura', NULL, '1', '2018-02-06 16:20:41', '2018-02-06 16:20:41', 'pdf', '<p>Este artigo desenvolve a quest&atilde;o do diagn&oacute;stico em psican&aacute;lise a partir de estudos feitos na pesquisa sobre o tema. Inicialmente, aborda-se a pr&oacute;pria concep&ccedil;&atilde;o de pesquisa em psican&aacute;lise e, a seguir, situa-se o conceito de estrutura, tal como formulado por Lacan, no cerne da discuss&atilde;o. Finalmente, apresenta-se a constru&ccedil;&atilde;o de um caso cl&iacute;nico para melhor localizar a rela&ccedil;&atilde;o entre fen&ocirc;meno e estrutura.</p>\r\n', '633522', 'spp__5a79f1f963fdd9_73028547.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f1f963fdd9_73028547.pdf'),
(48, 'Psicoterapia psicodinâmica breve - Dos precursores aos modelos atuais', NULL, '1', '2018-02-06 16:25:03', '2018-02-06 16:25:03', 'pdf', '<p>O artigo apresenta uma vis&atilde;o panor&acirc;mica da psicoterapia psicodin&acirc;mica breve, desde sua origem at&eacute; os dias atuais. Ap&oacute;s a localiza&ccedil;&atilde;o hist&oacute;rica de seu surgimento, faz refer&ecirc;ncia aos modelos te&oacute;ricos e t&eacute;cnicos mais utilizados nas &uacute;ltimas d&eacute;cadas e seus principais representantes. Inclui tamb&eacute;m algumas das principais contribui&ccedil;&otilde;es &agrave; aplica&ccedil;&atilde;o destas t&eacute;cnicas &agrave; popula&ccedil;&atilde;o infantil.</p>\r\n', '990551', 'spp__5a79f2ff4370f8_67967557.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f2ff4370f8_67967557.pdf'),
(49, 'Considerações sobre eu e o corpo em Lacan', NULL, '1', '2018-02-06 16:28:27', '2018-02-06 16:28:27', 'pdf', '', '454309', 'spp__5a79f3cb2ad881_59001495.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f3cb2ad881_59001495.pdf'),
(50, 'A escuta na psicanálise e a psicanálise da escuta', NULL, '1', '2018-02-06 16:30:17', '2018-02-06 16:30:17', 'pdf', '<p>O artigo tem por objetivo analisar a import&acirc;ncia da escuta na hist&oacute;ria da psican&aacute;lise e no processo anal&iacute;tico. Para tanto, &eacute; feito um percorrido nos aportes freudianos desde os tempos iniciais da psican&aacute;lise at&eacute; as importantes modifica&ccedil;&otilde;es t&eacute;cnicas propostas a partir da introdu&ccedil;&atilde;o do conceito de repeti&ccedil;&atilde;o. S&atilde;o consideradas, tamb&eacute;m, contribui&ccedil;&otilde;es de autores atuais que demarcam o campo anal&iacute;tico como um singular espa&ccedil;o de intersubjetividade.</p>\r\n', '853990', 'spp__5a79f439d3c201_87785548.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f439d3c201_87785548.pdf'),
(51, 'A escuta analítica, o corpo e a contemporaneidade', NULL, '1', '2018-02-06 16:34:46', '2018-02-06 16:34:46', 'pdf', '<p>O trabalho trata da escuta anal&iacute;tica face &agrave; contemporaneidade, pressupondo a psican&aacute;lise um saber aberto. A psican&aacute;lise lida com um corpo que &eacute; falado antes de falar, atravessado pelo investimento libidinal do outro, condi&ccedil;&atilde;o para sua erogeneiza&ccedil;&atilde;o. O corpo fantasm&aacute;tico &eacute; a matriz do inconsciente. Corpo e imagem, isto &eacute;, corpo e fantasma s&atilde;o indissoci&aacute;veis. A imagem corporal &eacute; a r&eacute;plica do corpo impregnado de m&uacute;ltiplas proje&ccedil;&otilde;es e viv&ecirc;ncias, sendo uma das vias privilegiadas de acesso ao inconsciente. A escuta anal&iacute;tica tem como condi&ccedil;&atilde;o de possibilidade a escuta do pr&oacute;prio corpo do analista para que este possa funcionar como uma caixa de resson&acirc;ncia frente &agrave; avalanche de impress&otilde;es sensoriais, numa linguagem verbal e n&atilde;o verbal que v&ecirc;m do analisando, &agrave;s vezes sinalizada primordialmente no corpo. Escutar com o pr&oacute;prio corpo &eacute; ser capaz de captar a atmosfera e viver as intensidades que o encontro anal&iacute;tico engendra.</p>\r\n', '494824', 'spp__5a79f546bfb6d1_56261589.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f546bfb6d1_56261589.pdf'),
(52, 'A transferência na clínica psicanalítica', NULL, '1', '2018-02-06 16:36:11', '2018-02-06 16:36:11', 'pdf', '', '208754', 'spp__5a79f59bb8d2a4_11582796.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f59bb8d2a4_11582796.pdf'),
(53, 'A transferência na pesquisa em psicanálise - Algumas considerações', NULL, '1', '2018-02-06 16:37:08', '2018-02-06 16:37:08', 'pdf', '<p>O presente artigo consiste em uma breve revis&atilde;o te&oacute;rica acerca de algumas considera&ccedil;&otilde;es pertinentes &agrave; pesquisa em psican&aacute;lise, considerando, mais especificamente, o &lsquo;fen&ocirc;meno da transfer&ecirc;ncia&rsquo; na pesquisa psicanal&iacute;tica, conforme citado primeiramente por Freud e atrav&eacute;s da leitura de outros autores contempor&acirc;neos. Considerando a amplitude do tema, optou-se por apresentar um recorte abordando, inicialmente, o conceito de &lsquo;transfer&ecirc;ncia&rsquo;. Em um segundo momento, ser&atilde;o trazidos alguns aspectos referentes &agrave; pesquisa em psican&aacute;lise para, finalmente, discutir o fen&ocirc;meno de transfer&ecirc;ncia na pesquisa psicanal&iacute;tica.</p>\r\n', '939243', 'spp__5a79f5d4bffad2_32117143.pdf', 'http://www.ava.spp.psc.br/material/spp__5a79f5d4bffad2_32117143.pdf'),
