INSERT INTO `modulo` (`id`, `titulo`, `slug`, `status`, `created_at`, `updated_at`, `texto`, `professor`, `code`) VALUES
(5, 'Mód. 01 - Introdução à Psicanálise', 'mod-01-introducao-a-psicanalise', '1', '2017-07-20 11:40:58', '2017-07-20 11:40:58', '<p>EMENTA</p>\r\n\r\n<p>Hist&oacute;ria do movimento psicanal&iacute;tico;&nbsp;Conceitos elementares do que &eacute; psican&aacute;lise;&nbsp;Fundamentos gerais do funcionamento do psiquismo humano;&nbsp;Diferen&ccedil;as entre psiquiatria, psicologia e psican&aacute;lise;&nbsp;O trip&eacute; da forma&ccedil;&atilde;o psicanal&iacute;tica.</p>\r\n', '', '117557'),
(6, 'Mód. 02 - Ética Psicanalítica', 'mod-02-etica-psicanalitica', '1', '2017-10-17 10:37:40', '2017-10-17 10:37:40', '<p>EMENTA:</p>\r\n\r\n<p>Conceitos e classifica&ccedil;&otilde;es de &eacute;tica; &Eacute;tica Deontol&oacute;gica e Diceol&oacute;gica; <em>Pathos, Ethos </em>e<em> Technos</em>; &Eacute;tica e Moral; &Eacute;tica e cidadania; O Complexo de &Eacute;dipo e a &eacute;tica; O caso &ldquo;Anna O.&rdquo;; C&oacute;digo de &Eacute;tica da Sociedade Psicanal&iacute;tica do Paran&aacute;.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '785877'),
(7, 'Mód.  03 - Teoria Psicanalítica I  -  Escola Freudiana', 'mod-03-teoria-psicanalitica-i-escola-freudiana', '1', '2017-11-27 15:04:47', '2017-11-27 15:04:47', '<p>EMENTA:</p>\r\n\r\n<p>Teoria topogr&aacute;fica: Consciente, Pr&eacute;-consciente e Inconsciente; Teoria estrutural: Id, Ego e Superego; Mecanismos de Defesa do Ego; Determinismo Ps&iacute;quico; Funcionamento do Aparelho Ps&iacute;quico, Fases do Desenvolvimento Psicossexual.</p>\r\n', '', '692458'),
(8, 'Mód.  04 - Psicofarmacologia', 'mod-04-psicofarmacologia', '1', '2017-11-27 16:13:34', '2017-11-27 16:13:34', '<p>EMENTA:</p>\r\n\r\n<p>Introdu&ccedil;&atilde;o: conceitos gerais; Estudo das altera&ccedil;&otilde;es comportamentais; Estudo das caracter&iacute;sticas bioqu&iacute;micas de agentes farmacol&oacute;gicos e seus efeitos na fisiologia do comportamento; Antipsic&oacute;ticos; Antidepressivos; Antiman&iacute;acos; Ansiol&iacute;ticos; Alucin&oacute;genos.</p>\r\n', '', '160093'),
(9, 'Mód.  05 - Teorias da Sexualidade I', 'mod-05-teorias-da-sexualidade-i', '1', '2017-11-27 16:15:47', '2017-11-27 16:15:47', '<p>EMENTA:</p>\r\n\r\n<p>As pesquisas de Masters &amp; Johnson; O Relat&oacute;rio de Shere Hite; Introdu&ccedil;&atilde;o ao pensamento freudiano: As fases do desenvolvimento psicossexual; O Complexo de &Eacute;dipo.</p>\r\n', '', '135645'),
(10, 'Mód. 06 - Teoria Psicanalítica II - Winnicott e M. Klein', 'mod-06-teoria-psicanalitica-ii-winnicott-e-m-klein', '1', '2017-11-27 16:16:56', '2017-11-27 16:16:56', '<p>EMENTA:</p>\r\n\r\n<p>Postulados de Melanie Klein; Posi&ccedil;&atilde;o esquizoparan&oacute;ide; Posi&ccedil;&atilde;o depressiva; Postulados de Winnicott; O <em>self</em> descrito por Winnicott; An&aacute;lise de crian&ccedil;as; Objetos transicionais; An&aacute;lise de psicoses.</p>\r\n', '', '656865'),
(11, 'Mód. 07 - Psicopatologia Psicanalítica I', 'mod-07-psicopatologia-psicanalitica-i', '1', '2017-11-27 16:21:31', '2017-11-27 16:21:31', '<p>EMENTA:</p>\r\n\r\n<p>Aspecto gen&eacute;tico da forma&ccedil;&atilde;o do indiv&iacute;duo; Aspecto metapsicol&oacute;gico da forma&ccedil;&atilde;o do car&aacute;ter; Ponto de vista t&oacute;pico; Ponto de vista econ&ocirc;mico; Mecanismos de defesa do Ego.</p>\r\n', '', '125879'),
(12, 'Mód. 08 - Teorias da Sexualidade II - Édipo e Narciso', 'mod-08-teorias-da-sexualidade-ii-edipo-e-narciso', '1', '2017-11-27 16:22:27', '2017-11-27 16:22:27', '<p>EMENTA:</p>\r\n\r\n<p>As fases do desenvolvimento psicossexual: Fase oral, Fase anal, Fase genital, Fase f&aacute;lica, Complexo de &Eacute;dipo; Per&iacute;odo de lat&ecirc;ncia; Fase genital; Narcisismo prim&aacute;rio; Narcisismo secund&aacute;rio; Configura&ccedil;&otilde;es das rela&ccedil;&otilde;es objetais e sua din&acirc;mica na fam&iacute;lia.</p>\r\n', '', '213550'),
(13, 'Mód. 09 - Psicopatologia II - Neurose e Psicose', 'mod-09-psicopatologia-ii-neurose-e-psicose', '1', '2017-11-27 16:23:18', '2017-11-27 16:23:18', '<p>EMENTA:</p>\r\n\r\n<p>Classifica&ccedil;&atilde;o das neuroses; Tipos de neuroses; Psicoses; Transtornos de personalidade; Transtornos de ansiedade; Transtornos alimentares; Transtornos sexuais; Transtornos f&oacute;bicos; Tratamento em psicoterapia.</p>\r\n', '', '998382'),
(14, 'Mód. 10 - Teorias da Sexualidade III - Perversões', 'mod-10-teorias-da-sexualidade-iii-perversoes', '1', '2017-11-27 16:23:56', '2017-11-27 16:23:56', '<p>EMENTA:</p>\r\n\r\n<p>An&aacute;lise do filme &ldquo;O Lenhador&rdquo;; As aberra&ccedil;&otilde;es sexuais; Conceito de parafilias; Homossexualismo e lesbianismo; Coprofilia e Coprofagia, Exibicionismo; Fetichismo; Fetichismo transv&eacute;stico; Frotteurismo; Pedofilia; Masoquismo e Sadismo Sexual; Voyeurismo e Zoofilia; Tratamentos qu&iacute;micos para a pedofilia.</p>\r\n\r\n<p>Essa aula &eacute; feita com base em cenas do filme&nbsp;&ldquo;O Lenhador&rdquo;. Assista ao mesmo no youtube:</p>\r\n\r\n<p>https://www.youtube.com/watch?v=--ij1XT6J4c</p>\r\n\r\n<p>https://www.youtube.com/watch?v=e-Vjhj96hFE</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '751777'),
(15, 'Mód. 11 - Teoria Psicanalítica III - Escola Junguiana', 'mod-11-teoria-psicanalitica-iii-escola-junguiana', '1', '2017-11-27 16:24:49', '2017-11-27 16:24:49', '<p>EMENTA:</p>\r\n\r\n<p>Breve biografia de Jung; O conceito de Psique em Jung; Inconsciente coletivo e inconsciente pessoal; Arqu&eacute;tipos; Imagem; S&iacute;mbolo; <em>Self</em>; <em>Anima</em> e <em>Animus</em>; A Consci&ecirc;ncia e o Ego descritos por Jung; Sombra; Persona; Energia Ps&iacute;quica; Sonhos.</p>\r\n', '', '168905'),
(16, 'Mód. 12 - Psicoterapia Psicanalítica Breve', 'mod-12-psicoterapia-psicanalitica-breve', '1', '2017-11-27 16:25:27', '2017-11-27 16:25:27', '<p>EMENTA:</p>\r\n\r\n<p>Psicoterapia Psicanal&iacute;ticas Breve e suas recomenda&ccedil;&otilde;es; Psicoterapia Focal; Psicoterapia de Apoio de Curta Dura&ccedil;&atilde;o; Psicoterapia de Apoio de Longa Dura&ccedil;&atilde;o.</p>\r\n', '', '323427'),
(17, 'Mód. 13 - Terapia Familiar - Abordagem Psicanalítica e Sistêmica', 'mod-13-terapia-familiar-abordagem-psicanalitica-e-sistemica', '1', '2017-11-27 16:30:29', '2017-11-27 16:30:29', '<p>EMENTA:</p>\r\n\r\n<p>O conceito de fam&iacute;lia; A fun&ccedil;&atilde;o da fam&iacute;lia: fun&ccedil;&atilde;o paterna e fun&ccedil;&atilde;o materna; A desestrutura&ccedil;&atilde;o familiar e suas consequ&ecirc;ncias sociais; S&iacute;ndrome do ninho vazio; Genograma; Teoria dos Sistemas.</p>\r\n', '', '122994'),
(18, 'Mód. 14 - Neuroanatomia e Neurofisiologia', 'mod-14-neuroanatomia-e-neurofisiologia', '1', '2017-11-27 16:31:24', '2017-11-27 16:31:24', '<p>EMENTA:</p>\r\n\r\n<p>Anatomia do Sistema Nervoso Central; Organiza&ccedil;&atilde;o do Sistema Nervoso Central; Fundamentos gerais da fisiologia; Neurofisiologia do funcionamento do neur&ocirc;nio e do Sistema Nervoso Central; Sinapses; Neurotransmissores; Rela&ccedil;&otilde;es entre processos mentais e o funcionamento cerebral.</p>\r\n', '', '362078'),
(19, 'Mód. 15 - Toxicopatologia - Narcose e Psicose', 'mod-15-toxicopatologia-narcose-e-psicose', '1', '2017-11-27 16:34:00', '2017-11-27 16:34:00', '<p>EMENTA:</p>\r\n\r\n<p>Drogas l&iacute;citas; Drogas il&iacute;citas; Drogas perturbadoras do Sistema Nervoso Central; Drogas Depressoras do Sistema Nervoso Central; Drogas estimulantes do Sistema Nervoso Central; Fixa&ccedil;&atilde;o oral e sua rela&ccedil;&atilde;o com as drogas; Narcose e psicose.</p>\r\n', '', '452142'),
(20, 'Mód. 16 - Análise Transacional', 'mod-16-analise-transacional', '1', '2017-11-27 16:34:41', '2017-11-27 16:34:41', '<p>EMENTA:</p>\r\n\r\n<p>Breve hist&oacute;ria de Eric Berne; Os Estado de Ego Pai, Adulto e Crian&ccedil;a; An&aacute;lise Funcional dos Estados de Ego; Transa&ccedil;&otilde;es; Car&iacute;cias; Estrutura&ccedil;&atilde;o do Tempo; Jogos Psicol&oacute;gicos; Posi&ccedil;&atilde;o Existencial; Emo&ccedil;&otilde;es; Scripts.</p>\r\n', '', '269259'),
(21, 'Mód. 17 - Teoria Psicanalítica IV - Escola Lacaniana', 'mod-17-teoria-psicanalitica-iv-escola-lacaniana', '1', '2017-11-27 16:35:46', '2017-11-27 16:35:46', '<p>EMENTA:</p>\r\n\r\n<p>O desejo e sua interpreta&ccedil;&atilde;o; A posi&ccedil;&atilde;o do est&aacute;gio do espelho; Os quatro &ldquo;S&rdquo;; Significante e Significado; Real, Simb&oacute;lico e Imagin&aacute;rio; O Sujeito Suposto Saber; Neurose Obsessiva, Psicose e pervers&atilde;o em Lacan.</p>\r\n', '', '383528'),
(22, 'Mód. 18 - Teorias das Pulsões', 'mod-18-teorias-das-pulsoes', '1', '2017-11-27 16:36:27', '2017-11-27 16:36:27', '<p>EMENTA:</p>\r\n\r\n<p>A puls&atilde;o na fase oral; A puls&atilde;o na fase anal; A puls&atilde;o na fase f&aacute;lica;&nbsp; Os instintos e suas vicissitudes; As transforma&ccedil;&otilde;es do instinto exemplificadas no erotismo anal; O instinto greg&aacute;rio; As duas classes de instintos; Princ&iacute;pio de prazer e princ&iacute;pio de realidade; A teoria dos instintos.</p>\r\n', '', '581510'),
(23, 'Mód. 19 - Técnica Psicanalítica I', 'mod-19-tecnica-psicanalitica-i', '1', '2017-11-27 16:37:05', '2017-11-27 16:37:05', '<p>EMENTA:</p>\r\n\r\n<p>Como agem as terapias anal&iacute;ticas; O v&iacute;nculo anal&iacute;tico; Interpreta&ccedil;&atilde;o dos sonhos; Associa&ccedil;&atilde;o livre; O campo anal&iacute;tico; An&aacute;lise dos chistes; An&aacute;lise dos Atos falhos; <em>Setting</em> anal&iacute;tico.</p>\r\n', '', '537130'),
(24, 'Mód. 20 - Terapia de Grupos - Freud e Bion', 'mod-20-terapia-de-grupos-freud-e-bion', '1', '2017-11-27 16:40:21', '2017-11-27 16:40:21', '<p>EMENTA:</p>\r\n\r\n<p>Conceito de grupos; A Din&acirc;mica dos grupos; V&iacute;nculos e configura&ccedil;&otilde;es vinculares; A influ&ecirc;ncia ed&iacute;pica na experi&ecirc;ncia grupal; Psicologia de grupo e a an&aacute;lise do ego; Hist&oacute;rico do entendimento da din&acirc;mica grupal.</p>\r\n', '', '550196'),
(25, 'Mód. 21 - Técnica Psicanalítica II', 'mod-21-tecnica-psicanalitica-ii', '1', '2017-11-27 16:41:17', '2017-11-27 16:41:17', '<p>EMENTA:</p>\r\n\r\n<p>A t&eacute;cnica da Psican&aacute;lise; A hist&oacute;ria da t&eacute;cnica psicanal&iacute;tica; A proposta de Breuer e os artigos t&eacute;cnicos de Freud; Estudo dos principais conceitos que sustentam a pr&aacute;tica psicanal&iacute;tica; Observa&ccedil;&otilde;es e exemplos da pr&aacute;tica anal&iacute;tica.</p>\r\n', '', '244812'),
(26, 'Mód. 22 - Casos Clínicos', 'mod-22-casos-clinicos', '1', '2017-11-27 16:42:20', '2017-11-27 16:42:20', '<p>EMENTA:</p>\r\n\r\n<p>Um caso de paranoia; Casos cl&iacute;nicos; Observa&ccedil;&atilde;o de um caso grave de hemianestesia em um homem hist&eacute;rico; Um caso de histeria; um caso de neurose obsessiva; O caso Schereber; A psicog&ecirc;nese de um caso de homossexualismo numa mulher.</p>\r\n', '', '318194'),
(27, 'Mód. 23 - Psicanálise e Religião', 'mod-23-psicanalise-e-religiao', '1', '2017-11-27 16:43:06', '2017-11-27 16:43:06', '<p>EMENTA:</p>\r\n\r\n<p>Pensamento, sentimento e comportamento; Subjetividade e religiosidade; Figura paterna e a Divindade; Aspectos psicol&oacute;gicos dos grupos religiosos; A religiosidade na &oacute;tica freudiana; O reino dos desejos ocultos; Possess&atilde;o demon&iacute;aca e desejos inconscientes.</p>\r\n', '', '683336'),
(28, 'Mód. 24 - Psicanálise e o Social', 'mod-24-psicanalise-e-o-social', '1', '2017-11-27 16:48:02', '2017-11-27 16:48:02', '<p>EMENTA:</p>\r\n\r\n<p>&ldquo;Psicologia&nbsp; das massas e an&aacute;lise do eu&rdquo; (1921); Abordagem psicanal&iacute;tica no campo social; Grupos sociais em &Eacute;mile Durkhein; Personalidade, temperamento e car&aacute;ter&rdquo;; &ldquo;O mal-estar na civiliza&ccedil;&atilde;o&rdquo; (1930)&nbsp; versus a atualidade; Conceitos sociais e cultura.</p>\r\n', '', '915616'),
(29, 'Mód. 24 - Psicanálise e Filosofia', 'mod-24-psicanalise-e-filosofia', '1', '2018-10-02 11:11:59', '2018-10-02 11:11:59', '', '', '466380');
