INSERT INTO `siteconfig` (`id`, `titulo`, `descricao`, `facebook`, `twitter`, `linkedin`, `skype`, `youtube`, `img`, `ativo`, `telefone`, `fax`, `email`, `endereco`, `mapa`, `token_instagran`, `usuario_instagran`, `rss`, `contato`, `analytics`, `emailenvio`, `host`, `senhaemail`) VALUES
(1, 'Sociedade Psicanalista do Paraná', 'A Sociedade Psicanalítica do Paraná iniciou seus trabalhos como APPP no ano de 2007, sendo fundada no dia seis de agosto de 2009, por um grupo de psicanalistas que perceberam a necessidade de haver, no Estado do Paraná, uma instituição séria que pudesse dar o devido suporte ao trabalho de inúmeros psicanalistas, bem como formar e especializar tantos outros, sejam profissionais da Psicanálise ou não, com conhecimentos sobre a teoria e técnica psicanalítica.\r\n\r\nA SPP tem obtido prestígio por seu trabalho na esfera municipal, bem como pelo Estado. Por sua atividade comprometida com o bem estar do ser humano, recebeu reconhecimento de instituição de Utilidade Pública Municipal em 2011, através da Lei 720/11 e como Utilidade Pública Estadual em 2013, através da Lei número 17.636. Não apenas isso, mas também tem reconhecimento internacional pela USACCCA, sediada em Orlando, na Flórida/EUA.\r\n\r\nA instituição objetiva manter a formação continuada de seus membros através de diversos Cursos de capacitação. Também realizamos bienalmente o Congresso de Psicanálise, além da produção e difusão de artigos científicos em revistas e publicações em nosso Jornal Semestral.\r\n\r\nAtuando com seriedade e dedicação de seus membros, a SPP hoje tem sua sede Executiva na cidade de Londrina e sede Administrativa em Cornélio Procópio. Podendo mudar sua sede executiva de local conforme sua alternância de presidência.', 'http://facebook.com/ipimaringa', '.', '.', '.', '.', 'cnp__56891d5f47fcc.png', 'Sim', '(43) 03132-1274', '.', 'contato@ipimaringa.org.br', 'Av. Arthur Thomas 1036, sala 9 - Jardim Bandeirantes - Londrina', '', '.', '.', '.', 'Sílvio de Souza Mariano', '.', '', '', '');
