(491, 244, 22, 'spp__5cae4cada55e92_81661580.docx', 8, '2019-04-10 17:06:05', '2019-04-10 17:06:05', 1, '9.0', 358, '<p>Considera&ccedil;&otilde;es&nbsp;</p>\r\n\r\n<p>V&acirc;nia,seu pensamento sobre o desenrolar do texto do filme que tr&aacute;s a trajetoria da obra e t&eacute;cnica de Freud ,sua &eacute;tica e comprometimento com sua obra e como fundamentou sua obra,e outros te&oacute;ricos tentando formular e se diferenciar foge de sua &eacute;tica.</p>\r\n\r\n<p>Sugiro que leia mais sobre t&eacute;cnica,pois a transfer&ecirc;ncia foi uma transfer&ecirc;ncia erotizada,ele quis usar as descobertas dela dos sonhos e tirar proveito e se apossar da id&eacute;ia e descoberta que ele no seu processo anal&iacute;tico. Foi onde Freud viu isso e a alertou o afastamento,ele se se envolveu com ela porque viu o seu potencial.</p>\r\n\r\n<p>Epelo mau car&aacute;ter que Freud o afastou da sociedade.</p>\r\n\r\n<p>Voc&ecirc; boas contribui&ccedil;&otilde;es sobre o caso,pesquisando e indo al&eacute;m,parab&eacute;ns.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
