(567, 244, 32, 'spp__5cb93a57ce7fb5_64522173.docx', 8, '2019-04-19 00:02:47', '2019-04-19 00:02:47', 1, '80.0', 358, '<p>Cordiais sauda&ccedil;&atilde;o</p>\r\n\r\n<p>A candidata V&acirc;nia</p>\r\n\r\n<p>Sua vis&atilde;o da t&eacute;cnica mostra que precisa buscar mais a parte te&oacute;rica&nbsp; e T&eacute;cnica; sobre: Contratransfer&ecirc;ncia; Transfer&ecirc;nciaa er&oacute;tica,Neurose de Transfer&ecirc;ncia e Puls&otilde;es e&nbsp; Seus Destinos - Freud [fREUD,1915] ,em Obras incompletas de Sigmund Freud - aut&ecirc;ntica. Nos Dicion&aacute;rios de Psican&aacute;lise de Elisabeth Roudinesco e&nbsp; Daivid E.Zimerman- Vocabul&aacute;rio Contepor&acirc;neo de Psican&aacute;lise.</p>\r\n\r\n<p>Andr&eacute; Green- Narcisismo de Vida/ Narsisismo de Morte</p>\r\n\r\n<p>A paciente era uma Hist&eacute;rica,com puls&otilde;es sexuais; s&aacute;dismo/ masoquismo,ilustrado pela transforma&ccedil;&atilde;o do amor em &oacute;dio. A puls&atilde;o opera numa zona de indeterminado,de indistin&ccedil;&atilde;o entre o corpo e o aparelho ps&iacute;quico.</p>\r\n\r\n<p>Bons estudos!</p>\r\n\r\n<p>Gisele</p>\r\n'),
