(579, 521, 56, 'spp__5cbfa5d243e554_84797078.doc', 7, '2019-04-23 20:54:58', '2019-04-23 20:54:58', 1, '8.5', 358, '<p>Boa noite</p>\r\n\r\n<p>Eilcineia</p>\r\n\r\n<p>Sua elabora&ccedil;&atilde;o do pensamento anal&iacute;tico est&atilde;o coerentes,conseguiu fazer um breve resumo do artigo do Freud.</p>\r\n\r\n<p>Poderia ter explorado este texto,t&atilde;o atual,com outros te&oacute;ricos,geralmente usamos de 3 h&aacute; 4 autores;</p>\r\n\r\n<p>Quando terminar um trabalho revise a sua escrita.</p>\r\n\r\n<p>Estamos sempre nos aprimorando.</p>\r\n\r\n<p>Bons estudos</p>\r\n\r\n<p>Coordenadora</p>\r\n\r\n<p>Psc.Gisele Azambuja Velilha</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
