(684, 504, 20, 'spp__5cdda812624681_61112715.pdf', 22, '2019-05-16 15:12:34', '2019-05-16 15:12:34', 1, '7.0', 430, '<p>Boa tarde. Sauda&ccedil;&otilde;es Psicanal&iacute;ticas! Cuidado! Existem v&aacute;rios erros no trabalho, principalmente quanto a teoria Junguiana, que &eacute; o intu&iacute;to desse trabalho. Houveram erros em rela&ccedil;&atilde;o a eneagrama, voc&ecirc; tamb&eacute;m confundiu &quot;atitudes&quot;,&nbsp; temperamento, com Inconsciente, e s&atilde;o coisas bemmm diferentes, entre outros erros. Favor rever os materiais de estudo referentes a aula Teoria Junguiana, para uma melhor compreens&atilde;o da mat&eacute;ria.&nbsp; Em um dado momento voc&ecirc; tamb&eacute;m ressaltou &quot;o eniagrama baseado no complexo de &eacute;dipo&quot; (discurso do trabalho), todavia, eneagrama n&atilde;o tem nada haver com complexo de &eacute;dipo, creio que voc&ecirc; est&aacute; confundindo as teorias, o eneagrama explica sobre as diferen&ccedil;as de temperamentos, as chamadas atitudes de Jung, que depois foi explicado posterior: pensamento, sensa&ccedil;&atilde;o, intui&ccedil;&atilde;o e sentimento. Lembre-se que temperamento &eacute; uma heran&ccedil;a gen&eacute;tica, independende das viv&ecirc;ncias, nascemos com um temperamento e morremos com ele, logo, ele n&atilde;o muda. J&aacute; car&aacute;ter &eacute; uma heran&ccedil;a sociocultural, e prov&eacute;m das fases do car&aacute;ter (oral, anal, f&aacute;lico, latencia, puberdade, maturidade e velhice), e s&oacute; para fechar o entendimento a personalidade &eacute; a soma de temperamento mais o car&aacute;ter, s&oacute; expliquei para voc&ecirc; entender. Sempre lembre-se que o temperamento &eacute; uma heran&ccedil;a gen&eacute;tica, isso acompanha os seres humanos desde o &uacute;tero materno. Enfim, analisei mais a parte da diferen&ccedil;a do<u> Inconsciente coletivo e individual</u>, que &eacute; o que o solicitei no trabalho, que consta no in&iacute;cio do seu trabalho, e desconsiderei o final do trabalho. D&aacute; uma lida no material que tenho certeza que voc&ecirc; entender&aacute; as falhinhas do trabalho. Deus aben&ccedil;oe. =)</p>\r\n'),
